import React from 'react';

function regButt() {
  const handleClick = () => {
    alert('Button was clicked!');
  };

  return (
    <form onSubmit={handleClick}>

    <button 
    onClick={handleClick}
    type="button">
    Click
      
    </button>

    </form>
    
  );
}

export default regButt;
